import React from 'react';
// import { v4 as uuidv4 } from "uuid";

export default function Image({ setDisplay, img }) {
    return (
        <div id="bigimg_container">
            < img
                style={{
                    cursor: "url('https://img.icons8.com/ios/20/ffffff/delete-sign.png'), auto"
                }}
                onClick={() => {
                    setDisplay("portfolio")
                }}
                // alt={}
                // className="main-image"
                // key={uuidv4()}
                src={require(`./../assets/photos/${img}.png`)}
            />

        </div>
    )
}
